const helloWorld = require('../../exercises/easy/ex1-hello-world');

describe('hello world function', () => {
  test('should log "Hello World!" to the console', () => {
    const consoleSpy = jest.spyOn(console, 'log');
    helloWorld();
    expect(consoleSpy).toHaveBeenCalledWith('Hello World!');
    consoleSpy.mockRestore();
  });
});

const showAllTypes = require('../../exercises/easy/ex2-type-checker');

describe('Show All Types function', () => {
  test('should return an object with all the types', () => {
    const result = showAllTypes();

    expect(result).toHaveProperty('object');
    expect(result).toHaveProperty('array');
    expect(result).toHaveProperty('string');
    expect(result).toHaveProperty('number');
    expect(result).toHaveProperty('boolean');
    expect(result).toHaveProperty('null');
    expect(result).toHaveProperty('undefined');
    expect(result).toHaveProperty('nan');

    expect(result.object).toBe('object');
    expect(result.array).toBe('object');
    expect(result.string).toBe('string');
    expect(result.number).toBe('number');
    expect(result.boolean).toBe('boolean');
    expect(result.null).toBe('object');
    expect(result.undefined).toBe('undefined');
    expect(result.nan).toBe('number');
  });
});

const screamName = require('../../exercises/easy/ex6-name-screamer');

describe('Name Screamer function', () => {
  test('should convert name to uppercase and add exclamation marks', () => {
    expect(screamName('john')).toBe('JOHN!!!');
    expect(screamName('Sarah')).toBe('SARAH!!!');
    expect(screamName('bob smith')).toBe('BOB SMITH!!!');
  });
});

const checkResolution = require('../../exercises/medium/ex3-resolution-checker');

describe('Resolution Checker function', () => {
  test('should return "landscape" when width > height', () => {
    expect(checkResolution(1920, 1080)).toBe('landscape');
    expect(checkResolution(800, 600)).toBe('landscape');
  });

  test('should return "portrait" when height >= width', () => {
    expect(checkResolution(1080, 1920)).toBe('portrait');
    expect(checkResolution(500, 500)).toBe('portrait');
  });
});

const reverseString = require('../../exercises/medium/ex9-reverse-string');

describe('Reverse String function', () => {
  test('should reverse a string', () => {
    expect(reverseString('hello')).toBe('olleh');
    expect(reverseString('JavaScript')).toBe('tpircSavaJ');
    expect(reverseString('12345')).toBe('54321');
  });

  test('should handle empty string', () => {
    expect(reverseString('')).toBe('');
  });

  test('should handle single character', () => {
    expect(reverseString('a')).toBe('a');
  });
});

const rollDice = require('../../exercises/medium/ex4-dice-roller');

describe('Dice Roller function', () => {
  test('should return a number between 1 and 6', () => {
    // Run multiple tests to ensure randomness
    for (let i = 0; i < 100; i++) {
      const result = rollDice();
      expect(result).toBeGreaterThanOrEqual(1);
      expect(result).toBeLessThanOrEqual(6);
      expect(Number.isInteger(result)).toBe(true);
    }
  });
});

const createLyrics = require('../../exercises/hard/ex5-template-lyrics');

describe('Template Literals Lyrics function', () => {
  test('should create lyrics using template literals', () => {
    const songData = {
      artist: 'Test Artist',
      title: 'Test Song',
      verse: 'This is a test verse',
      chorus: 'This is a test chorus'
    };

    const result = createLyrics(songData);

    expect(result).toContain(songData.artist);
    expect(result).toContain(songData.title);
    expect(result).toContain(songData.verse);
    expect(result).toContain(songData.chorus);

    const functionString = createLyrics.toString();
    expect(functionString).toMatch(/`.*\${.*}.*`/s);
  });
});

const { Player, createPlayer } = require('../../exercises/hard/ex7-player-class');

describe('Player Class', () => {
  test('should create a player with all required properties', () => {
    const player = new Player('Hero', 100, 'Sword', 10, 25);

    expect(player.name).toBe('Hero');
    expect(player.health).toBe(100);
    expect(player.weapon).toBe('Sword');
    expect(player.speed).toBe(10);
    expect(player.damage).toBe(25);
  });

  test('createPlayer function should return a Player instance', () => {
    const player = createPlayer('Villain', 80, 'Axe', 8, 30);

    expect(player instanceof Player).toBe(true);
    expect(player.name).toBe('Villain');
    expect(player.health).toBe(80);
    expect(player.weapon).toBe('Axe');
    expect(player.speed).toBe(8);
    expect(player.damage).toBe(30);
  });
});

const simulateBattle = require('../../exercises/hard/ex8-battle-simulation');

describe('Battle Simulation function', () => {
  test('should reduce health of both players based on damage', () => {
    const player1 = { name: 'Hero', health: 100, damage: 20, weapon: 'Sword', speed: 10 };
    const player2 = { name: 'Enemy', health: 80, damage: 15, weapon: 'Axe', speed: 8 };

    const result = simulateBattle(player1, player2);

    expect(result).toHaveProperty('player1Health');
    expect(result).toHaveProperty('player2Health');
    expect(result.player1Health).toBe(85); // 100 - 15
    expect(result.player2Health).toBe(60); // 80 - 20
  });
});

